    return (
      <React.Fragment>
        <div className="ad-wrapper">
          <Header logout={this.props.logout} userinfo={this.props.userinfo} />
          <section className="head" style={{ fontSize: "2rem", padding: "1rem" }}>
            Welcome Admin
